import React from 'react';
import Particles from "react-tsparticles";
import './App.css';
import Chair from './Chair'
import particlesOptions from "./particles.json";

function App() {
    return (
      <div className="App">
          <header className="App-header">
            <Chair />
            <Particles options={particlesOptions}/>
          </header>
      </div>
    );
}

export default App;
